import React, { Component } from 'react';

class SidebarComponent extends Component {
    render(){
        return(
            <div className="container-fluid">
                <nav className="nav flex-column nav-pills">
                    <a className="nav-link active" href="/dashboard" data-bs-toggle="pill" data-bs-target="#v-pills-dashboard" type="button" role="tab" aria-selected="true">Dashboard</a>
                    <a className="nav-link" href="/catalog" data-bs-toggle="pill" data-bs-target="#v-pills-catalog" type="button" role="tab" aria-selected="false">Catalog</a>
                </nav>

                <nav className="nav flex-column nav-pills">
                    <a className="nav-link active" href="/dashboard" aria-current="page" data-bs-toggle="pill" data-bs-target="#v-pills-dashboard" type="button" role="tab" aria-selected="true">Dashboard</a>
                    <a className="nav-link" href="/catalog" data-bs-toggle="pill" data-bs-target="#v-pills-catalog" type="button" role="tab" aria-selected="false">Catalog</a>
                </nav>
            </div>
        );
    }
}

export default SidebarComponent;
